#!/usr/bin/env python3

import os, sys
test = ""


buffer = []
for i,ch in enumerate(test):
    print(f'starting: {buffer} adding {ch}')

    if len(buffer) < 14:
        buffer.append(ch)
        continue

    buffer = buffer[1:]
    buffer.append(ch)
    if len(set(buffer)) == len(buffer):
        print(f'{i+1}, {buffer}')
        sys.exit(0)

